    navigation.setOptions({
        headerTitle: "Выбор упражнений",
      })
  return (
    <View style={styles.container}>
        <Text>sdfsd</Text>
        <Picker
          selectedValue={value} 
          onValueChange={(itemValue)=>{
              console.log()
            setValue(itemValue)
          }}>          
       <Picker.Item label="Выберите упражнения" value="Выберите упражнения" />
         {["отжимания", "подтягивания"].map((tr)=>  <Picker.Item label={tr} value={tr} />)}
       </Picker>   
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  title:{
    paddingBottom: 100
  }
});
